package src.dasar;

public class Kelaselseif {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Integer umur=5;
		if (umur <= 5) {
			System.out.println("PAUD");
			
		} else if (umur >= 6 && umur <= 7) {
			System.out.println("TK");
			
		}else {
			System.out.println("Sekolah");

		}
	}

}
